import styled from 'styled-components';

const Input = styled('input')`
outline: none;
height:28px;
line-height: 28px;
padding: 0 8px;
border-radius: 4px;
font-size: inherit;
font-family:inherit;
border: 1px solid var(--lightText);
margin: 0 10px;
width: 200px;
`

export default Input;
